import classes from './Cart.module.css';
// this is the modal for cart
const Cart = () => {
  return (
    <div className={classes['cart-items']}>
      cartItems
      <div className={classes.total}>12.11</div>
      <div className={classes.actions}>
        <button>Buy</button>
      </div>
    </div>
  );
};

export default Cart;
